function openSavePersonForProjectClick(n,t,i,r,u){n!==null?$(".user-information>.user-name").text(n):$(".user-information>.user-name").text("");t!=="None"?$(".user-information>.user-industry").text(t):$(".user-information>.user-industry").text("");i!==null?$(".user-information>.user-location").text(i):$(".user-information>.user-location").text("");$(".user>.user-image").attr("src",r);$("#ChosenSaveUserId").val(u);$.ajax({type:"GET",url:"/Relationship/GetCurrentCompanyProjectsNotSavedWithUser",data:{userId:u},success:function(n){var t=$(".project-dropdown>select");$(t).find("option").remove();jQuery(n).each(function(n,i){$(t).append("<option value='"+i.id+"'>"+i.name+"<\/option>")})},error:function(n,t,i){console.log("Relationship.GetCurrentCompanyProjectsNotSavedWithUser: some problem happened. ErrorMessage: "+t+" ErrorThrown:"+i)}})}